INSERT INTO Animes(AnimeID, AnimeTitle, AnimeDesc, TypeID, AiredBegin, AiredEnd, Premiered, Duration, PosterUrl) VALUES (469, CONCAT('Dungeon ni Deai wo Motomeru no wa Machigatteiru Darou ka II'), CONCAT('It is business as usual in the massive city of Orario, where legions of adventurers gather to explore the monster-infested "Dungeon." Among them is the easily flustered yet brave Bell Cranel, the sole member of the Hestia Familia. With the help of his demi-human supporter Liliruca Arde and competent blacksmith Welf Crozzo, Bell has earned the title of Little Rookie by becoming Orario', CHAR(39), 's fastest-growing adventurer thanks to his endeavors within the deeper levels of the Dungeon.<br><br>Dungeon ni Deai wo Motomeru no wa Machigatteiru Darou ka II continues Bell', CHAR(39), 's adventures as he tries to bring glory to his goddess and protect those he cares about. However, various familias and gods across the city begin to take notice of his achievements and attempt to add him to their ranks.<br>
